import React, { useState } from 'react'
import Pagination from "react-bootstrap/Pagination"

const PaginationComponenet = ({ total=0, itemsPerPage=10, currentPage=1, onPageChange }) => {

    const [totalPages, set] = useState(0);

    return (
        <Pagination>
            <Pagination.Prev />
            <Pagination.Item>1</Pagination.Item>
            <Pagination.Item>1</Pagination.Item>
            <Pagination.Next />
        </Pagination>
    )
}

export default PaginationComponenet;
